    def setSpeed(self):
        if(self.current_speed > self.commanded_speed):  #limit the speed
            return self.commanded_speed
        return self.TestMode_Speed.value()
        
    def setBraking(self):
        return self.TestMode_Braking.value()
    
    def setAuthority(self):
        return self.TestMode_Authority.value()
    
    def setCommandedSpeed(self):
        self.commanded_speed = self.TestMode_CommandedSpeed.value()
        return self.TestMode_CommandedSpeed.value()
        
    def setKp(self):
        self.k_p = self.TestEngineerMode_setKp.value()
        return self.k_p
    
    def setKi(self):
        self.k_i = self.TestEngineerMode_setKi.value()
        return self.TestEngineerMode_setKi.value()
    
    def setEmergencyBrake(self):
        return self.TestMode_EmergencyBrake.isChecked()
    
    def setTemperature(self):
        return self.TestMode_Temperature.value()
    
    def setLights(self):
        return self.TestMode_Lights.currentIndex()
    
    def setDoors(self):
        return self.TestMode_Doors.currentIndex()
    
    def setAdvertisements(self):
        return self.TestMode_Advertisements.isChecked()
    
    def setAnnouncements(self):
        return self.TestMode_Announcements.isChecked()
    
    def setEngineFault(self):
        return self.TestMode_EngineFault.isChecked()
    
    def setPowerFault(self):
        return self.TestMode_PowerFault.isChecked()
    
    def setTrackFault(self):
        return self.TestMode_TrackFault.isChecked()
    
    def setCircuitFault(self):
        return self.TestMode_CircuitFault.isChecked()

    def setCurrentSpeed(self):
        self.current_speed = self.TestMode_CurrentSpeed.value()
        return self.TestMode_CurrentSpeed.value()

    def setNextStation(self):
        return self.TestMode_NextStation.currentText()

            
    def initializePID(self, kp_val, ki_val):
        self.kp = kp_val
        self.ki = ki_val
        self.pid = PID(self.k_p, self.k_i, 0.1, setpoint=self.commanded_speed)
        self.pid.output_limits = (0, 120000)
    
    def DisplayPowerOutput(self):
        self.pid.setpoint = self.commanded_speed
        self.initializePID(self.k_p, self.k_i)
        self.power = self.pid(self.current_speed)
        self.TestMode_PowerDisplay.display(self.power)
    
    
